// import "~slick-carousel/slick/slick.css"; 
// import "~slick-carousel/slick/slick-theme.css";



// export default Card;

import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import tshirt from '../../img/t.jpg'
import iphone from '../../img/11.jpg'
import free from '../../img/2971.jpg'
import treeking from '../../img/cp.jpg'
import mac from '../../img/422.jpg'
import jepant from '../../img/jepant.jpg'
import shoo from '../../img/s.jpg'
import ssss from '../../img/ssss.jpg'
import he from '../../img/he.jpg'
import '../../CSS/Style.css'
import "slick-carousel/slick/slick-theme.css";
export default function Slide(){

      const settings = {
        
      dots: false,
      infinite: true,
      speed: 600,
      slidesToShow: 5,
      slidesToScroll: 1
    };

    const slidesData = [
        {
          image :{tshirt},
          name: 'Black man T-shirtullam',
          discount: 1200,
          pric:1700
        }, {
            image :{tshirt},
            name: 'Black man T-shirtullam',
            discount: 1200,
            pric:1700 
        }, {
    
            image :{tshirt},
            name: 'Black man T-shirtullam',
            discount: 1200,
            pric:1700
        }, {
            image :{tshirt},
            name: 'Black man T-shirtullam',
            discount: 1200,
            pric:1700
        }, {
      
            image :{tshirt},
            name: 'Black man T-shirtullam',
            discount: 1200,
            pric:1700
        },
        {
            image :{tshirt},
            name: 'Black man T-shirtullam',
            discount: 1200,
            pric:1700
        },
      ];
    
    return (
      <div className="">
            <div className="container">
                <div className="row">
                    <div className="col-md-1">
                  
                    </div>
                    <div className="col-md-2">
                        <h2 className="topoffer">Top Offer</h2>
                        <hr className="hrline"/>
                    </div>
            </div>
      </div>
        <Slider {...settings}  className="slickimg productcard ">
        <div >
                    <img src={tshirt} className="imggs" />
                    <p class="procutname">Black man T-shirt</p>
                    <p className="" id="offer">Rs. 1700</p>
                    <p className="" id="price">Rs. 1500</p>
                   
                    
                </div>
            <div >
                    <img src={iphone} className="imggs" />
                    <p class="procutname">Apple I Phone 11</p>
                    <p className="" id="offer">Rs. 150500</p>
                    <p className="" id="price">Rs. 150000</p>
          </div>
          <div>
                    <img src={free} className="imggs" />
                    <p class="procutname"> Refrigerator</p>
                    <p className="" id="offer">Rs. 18500</p>
                    <p className="" id="price">Rs. 18000</p>
          </div>
          <div>
                    <img src={treeking} className="imggs" />
                    <p class="procutname">Treeking Bag</p>
                    <p className="" id="offer">Rs. 700</p>
                    <p className="" id="price">Rs. 500</p>
          </div>
          <div>
                    <img src={mac} className="imggs" />
                    <p class="procutname">  Mac Desktop</p>
                    <p className="" id="offer">Rs. 260000</p>
                    <p className="" id="price">Rs. 250000</p>
          </div>
          <div>
                    <img src={shoo} className="imggs" />
                    <p class="procutname">Rebook shoes</p>
                    <p className="" id="offer">Rs. 2000</p>
                    <p className="" id="price">Rs. 1400</p>          
          </div>
          <div>
                    <img src={jepant} className="imggs" />
                    <p class="procutname">Man Jeans Pants</p>
                    <p className="" id="offer">Rs. 1900</p>
                    <p className="" id="price">Rs. 1000</p>
          </div>
          <div>
                    <img src={he} className="imggs" />
                    <p class="procutname">Headphone</p>
                    <p className="" id="offer">Rs. 1200</p>
                    <p className="" id="price">Rs. 800</p>
          </div>
                  
        
        </Slider>
      </div>
    );
  
}
